float hash(vec2 p) { return fract(sin(dot(p,vec2(127.1,311.7)))*43758.5453); }

mat2 rot(float a) { float c=cos(a),s=sin(a); return mat2(c,-s,s,c); }

vec3 hsv(float h, float s, float v) {
    vec3 c = clamp(abs(mod(h*6.0+vec3(0,4,2),6.0)-3.0)-1.0,0.0,1.0);
    return v * mix(vec3(1), c, s);
}

void mainImage(out vec4 fragColor, in vec2 fragCoord) {
    vec2 uv = (fragCoord - 0.5*iResolution.xy) / iResolution.y;
    float t = iTime * 0.4;

    // kaleidoscope
    float angle = atan(uv.y, uv.x);
    float r = length(uv);
    float sectors = 8.0;
    angle = mod(angle, 3.14159*2.0/sectors);
    angle = abs(angle - 3.14159/sectors);
    uv = r * vec2(cos(angle), sin(angle));

    // domain warp
    uv *= rot(t*0.3 + r*2.0);
    vec2 p = uv * 3.0;

    float d = 0.0;
    for(int i = 0; i < 5; i++) {
        p = abs(p) / dot(p,p) - 1.0;
        p *= rot(t*0.2 + float(i)*0.5);
        d += exp(-3.0*abs(dot(p, vec2(sin(t+float(i)),cos(t*0.7+float(i))))));
    }

    // color
    float hue = d*0.15 + t*0.1 + r*0.5;
    vec3 col = hsv(hue, 0.8, min(d*0.4, 1.0));
    col += 0.03/abs(sin(r*10.0 - t*2.0)); // ring glow
    col = pow(col, vec3(0.9));

    fragColor = vec4(col, 1.0);
}

